    false,nt"url": null,nt"notes": "This narrative report for Lostwood National
    Wildlife Refuge outlines Refuge accomplishments from January through April of 1947.
    The report begins by summarizing the weather conditions, water conditions, and wildfires
    during this period. Wildlife- including migratory birds, upland game birds, big
    game animals, furbearers, predators, rodents, and raptors- is also covered. The
    Refuge development and maintenance section discusses physical developments and plantings.
    Resource management is outlined; topics include grazing and haying. The public relations
    section of the report describes Refuge visitors. N-R forms are attached.",nt"owner_org":
